import React from "react";
import Navbar from "../Common/navbar";
import img01 from "../Assestes/2.png";
import "../Common/style.css";
import menuPageJson from "../Common/menu.json";
function MenuPage() {
  return (
    <>
      <Navbar />
      {menuPageJson.map((menuPageJson) => {
        return (
          <div className="product">
            <div className="items">
              <div className="child">
                <div className="img">
                  <img src={img01} alt="img01" />
                </div>
                <div className="text">
                  <h3>{ menuPageJson.title }</h3>
                </div>
              </div>
            </div>
          </div>
        );
      })}
    </>
  );
}

export default MenuPage;
